import "./App.css";
import Airport from "./Airport";
import Travelling from "./Travelling";
import { Switch, Route, Redirect, BrowserRouter } from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route exact path="/">
          <BrowserRouter>
            <Airport />
          </BrowserRouter>
        </Route>
        <Route exact path="/passport">
          <BrowserRouter>
            <Airport />
          </BrowserRouter>
        </Route>
        <Route exact path="/travelling">
          <BrowserRouter>
            <Airport />
          </BrowserRouter>
        </Route>
        <Route exact path="/*">
          <Redirect
            to={{
              pathname: "/",
            }}
          />
        </Route>
      </Switch>
    </>
  );
}

export default App;
